prompts.structured_json_schema:
{
  "type": "object",
  "required": [
    "outcome",
    "outcomeReason",
    "candidateDetails",
    "nextSteps",
    "communicationAssessment",
    "skillsAssessment"
  ],
  "properties": {
    "outcome": {
      "enum": [
        "Candidate Shortlisted",
        "Candidate Not Shortlisted",
        "Candidate Not Interested",
        "Conditional Proceed",
        "Flagged for Human Review",
        "Call Rescheduled",
        "Call Disrupted"
      ],
      "type": "string"
    },
    "nextSteps": {
      "type": "object",
      "properties": {
        "callBackDetails": {
          "type": "object",
          "properties": {
            "date": {
              "type": "string"
            },
            "time": {
              "type": "string"
            }
          }
        },
        "reasonForNoInterest": {
          "type": "string"
        },
        "scheduledCallDetails": {
          "type": "object",
          "properties": {
            "date": {
              "type": "string"
            },
            "time": {
              "type": "string"
            }
          }
        },
        "rescheduledCallDetails": {
          "type": "object",
          "properties": {
            "date": {
              "type": "string"
            },
            "time": {
              "type": "string"
            }
          }
        }
      }
    },
    "outcomeReason": {
      "enum": [
        "All Criteria Met",
        "Near-Perfect Fit",
        "Hygiene Criteria Mismatch",
        "Skills/Experience Mismatch",
        "Declined Role",
        "Changed Mind",
        "Partial Criteria Match",
        "Uncertain Skills Assessment",
        "Call Disruption",
        "Silence/Technical Issues",
        "Unclear Responses",
        "Job Role/Company Queries",
        "Process/Next Steps",
        "Candidate Requested Reschedule"
      ],
      "type": "string"
    },
    "candidateDetails": {
      "type": "object",
      "properties": {
        "goals": {
          "type": "array",
          "items": {
            "type": "string"
          }
        },
        "industry": {
          "type": "string"
        },
        "challenges": {
          "type": "array",
          "items": {
            "type": "string"
          }
        }
      }
    },
    "skillsAssessment": {
      "type": "object",
      "properties": {
        "skill1": {
          "type": "object",
          "properties": {
            "score": {
              "type": "integer",
              "maximum": 5,
              "minimum": 1
            },
            "context": {
              "type": "string"
            }
          }
        },
        "skill2": {
          "type": "object",
          "properties": {
            "score": {
              "type": "integer",
              "maximum": 5,
              "minimum": 1
            },
            "context": {
              "type": "string"
            }
          }
        },
        "skill3": {
          "type": "object",
          "properties": {
            "score": {
              "type": "integer",
              "maximum": 5,
              "minimum": 1
            },
            "context": {
              "type": "string"
            }
          }
        },
        "skill4": {
          "type": "object",
          "properties": {
            "score": {
              "type": "integer",
              "maximum": 5,
              "minimum": 1
            },
            "context": {
              "type": "string"
            }
          }
        },
        "skill5": {
          "type": "object",
          "properties": {
            "score": {
              "type": "integer",
              "maximum": 5,
              "minimum": 1
            },
            "context": {
              "type": "string"
            }
          }
        }
      }
    },
    "communicationAssessment": {
      "enum": [
        "Very Poor",
        "Poor",
        "Average",
        "Good",
        "Excellent"
      ],
      "type": "string"
    }
  }
}
